import { useState } from "react";
import HomePage from "./components/Home";
import LoginPage from "./components/Login";

function App() {
  const [loggedIn, setLoggedIn] = useState();
  const logado = () => setLoggedIn(!loggedIn);

  return (
    <>
      {
        !loggedIn ? (<LoginPage {...{ logado }} />) 
         : 
        (<HomePage {...{ logado}} />)
      }
    </>
  );
}

export default App;
